description:
Accès à la liste des maquettes 3D des communes ou arrondissements de 2009 (sauf Quincieux).
Les maquettes 3D des communes de la Métropole de Lyon sont composées de deux à six couches de données suivant les cas. Les exécutables permettent de visualiser et de se déplacer en 3D dans ces maquettes. Ils contiennent une fiche d'aide à la navigation. A minima, toutes les maquettes se composent des deux couches suivantes :
- Le Modèle numérique de terrain (TIN) et ses textures associées ;
- Les bâtiments 3D texturés (BATIS).
Elles peuvent être complétées par une ou plusieurs des couches ci-dessous  :  
- Les surfaces en eau (WATER) et leurs textures associées ;
- Les bâtiments « remarquables » (mairies, églises etc…) ;
- Les ponts  « remarquables » ;
- Les objets « remarquables » (statues, fontaines etc…).
Ces données sont modélisées suivant la norme CityGML et fournies dans ce format. Ces maquettes sont produites avec les logiciels RhinoTerrain/RhinoCity et FME.

